import React from "react";
import Image from "./image";
import Imag from "../../IMG/avacado.jpeg";

const MemoryCardGame = () => {
  return (
    <div className="flex">
      <div className="grid grid-cols-4 gap-4 w-full h-screen">
        {Image.map((el) => {
          return (
            <div className="">
              <img src={el.src} alt="" />
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default MemoryCardGame;
